import uuidfrom django.db import modelsfrom apps.account.models import Accountfrom apps.account.models import PatientModelfrom apps.logus.models import BookedRoomModelclass IllnessHistory(models.Model):    series_number = models.CharField(max_length=255, default=uuid.uuid4)    diagnosis = models.CharField(max_length=511, )    # nurse = models.ForeignKey(Account, on_delete=models.CASCADE)    patient = models.ForeignKey(PatientModel, on_delete=models.CASCADE)    doctor = models.ForeignKey(Account, on_delete=models.CASCADE)    booking = models.ForeignKey(BookedRoomModel, on_delete=models.CASCADE)    def __str__(self):        return self.diagnosis